[Final response] Bubble sort is a simple sorting algorithm that repeatedly steps through the list, compares adjacent elements, and swaps them if they are in the wrong order. Here's how you can implement it in C:

```c
#include <stdio.h>

void bubbleSort(int arr[], int n) {
    for(int i = 0; i < n-1; i++) {    
        for (int j = 0; j < n-i-1; j++) { 
            if (arr[j] > arr[j+1]) { 
                // Swap arr[j] and arr[j+1]
                int temp = arr[j];
                arr[j] = arr[j+1];
                arr[j+1] = temp;
            }
        }
    }
}

void printArray(int arr[], int size) {
    int i;
    for (i=0; i < size; i++)
        printf("%d ", arr[i]);
    printf("\n");
}

int main() {
    int arr[] = {64, 34, 25, 12, 22, 11, 90};
    int n = sizeof(arr)/sizeof(arr[0]);
    bubbleSort(arr, n);
    printf("Sorted array: \n");
    printArray(arr, n);
    return 0;
}
```

This C program defines a `bubbleSort` function that sorts an array of integers in ascending order using the bubble sort algorithm. The `printArray` function is used to print the array elements. The `main` function initializes an array, sorts it using `bubbleSort`, and then prints the sorted array.

